t should display an error \"Please fill out this field.\" below Username textbox\n    Scenario: User gets error message below password textbox\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button with password and repeat password fields empty   \n    Then It should display an error \"Please fill out this field.\" below password textbox\n    Scenario: User gets error message below repeat password textbox\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button with repeat password empty   \n    Then It should display an error \"Please fill out this field.\" below repeat password textbox\n    #Scenario: The user is presented with error message for invalid username\n    #Given The user opens Register Page    \n    #When The user clicks \"Register\" button with  username with characters other than Letters, digits and @/./+/-/_  \n    #Then It should display an error message \"Please enter a valid username\"\n    Scenario: The user is presented with error message for username already exists\n    Given The user opens Register Page    \n    When The user enters a valid existing username with password and password confirmation  \n    Then It should display an error message \"Username already exists\"\n    Scenario: The user is presented with error message for password mismatch\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button after entering valid username and different passwords in password and password confirmation fields  \n    Then It should display an error message password_mismatch:The two password fields didn’t match.\n    Scenario: The user is presented with error message for password with characters less than 8\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button after entering valid username  password with characters less than 8  \n    Then It should display an error message Password should contain at least 8 characters\n    Scenario: The user is presented with error message for password with only numbers\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button after entering valid username  password with only numbers  \n    Then It should display an error message Password can’t be entirely numeric.\n    Scenario: The user is presented with error message for password too similar to your other personal information\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button after entering valid username  password similar to username  \n    Then It should display an error message password can’t be too similar to your other personal information.\n    Scenario: The user is presented with error message for commonly used password\n    Given The user opens Register Page    \n    When The user clicks \"Register\" button after entering valid username  and commonly used password \n    Then It should display an error message Password can’t be commonly used password\n    Scenario: The user is succesfully able to register \n    Given The user opens Register Page    \n    When The user clicks \"Register\" button after entering valid username  valid password and repeat password\n    Then The user should be redirected to Homepage with the message New Account Created. You are logged in as <username>\n    \n  ","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/Naveena/eclipse-workspace/DsAlgo/src/test/resources/Features/02_Register.feature","feature":{"location":{"line":3,"column":1},"tags":[{"location":{"line":2,"column":1},"name":"@tag","id":"f4d098df-329c-44ac-a20e-a88cd6b7133f"},{"location":{"line":2,"column":6},"name":"@TS_003","id":"31f4a2fd-2d32-40d1-b9b1-94e4aea43276"}],"language":"en","keyword":"Feature","name":"User registering a new user","description":"","children":[{"scenario":{"location":{"line":6,"column":3},"tags":[{"location":{"line":5,"column":3},"name":"@tag1","id":"7c79e336-b66c-40f er navigates to \"Graph\" Graph-Graph page\n   When The user clicks \"Try Here\" button on \"Graph-Graph\" page\n   Then The user should be redirected to Try Here page\n   \n   @tag4\n   Scenario Outline: The user is able to run code in Editor for Graph page\n   Given The user is in a page having an tryEditor with a Run button to test\n   When The user enter valid python code in tryEditor from sheet \"<Sheetname>\" and <RowNumber>\n   And The user clicks on run button\n   Then The user should be presented with Run result\n   \n    Examples: \n      | Sheetname  | RowNumber |\n      |PythonCode  |         0 |\n      \n   @tag5\n   Scenario Outline: The user is presented with error message for invalid code in Editor for Graph page\n   Given The user is in a page having an tryEditor with a Run button to test\n   When The user enter python code with invalid syntax in tryEditor from sheet \"<Sheetname>\" and <RowNumber>\n   And The user clicks on run button\n   Then The user should be presented with error message\n      Examples: \n      | Sheetname  | RowNumber |\n      |PythonCode  |         1 |\n      \n    \n      \n      @tag7\n      Scenario Outline: The user is able to navigate to graph page and click on Graph Representations link\n      Given The user is on the Graph Page after logged in\n      When The user clicks on Graph Representations link\n      Then The user should be redirected to Graph Representations page\n      \n      @tag8\n      Scenario: The user should be directed to editor page with run button to test python code from Graph Representations page\n      Given The user is in Graph Representations  page\n      When The user clicks \"Try Here\" button on \"Graph-GraphRepresentation\" page\n      Then The user should be redirected to Try Here page\n      \n      @tag9\n      Scenario Outline: The user is able to run code in Editor for Graph Representations page\n      Given The user is in a page having an tryEditor with a Run button to test\n      When etname>\" and <RowNumber>\n And   The user clicks on Run button after Entering invalid python code in stack tryEditor\n Then  The user should be presented with the Run output with popup\n \n Examples: \n | Sheetname  \t\t | RowNumber | \n | PythonCode |         1 |\n \n@tagStack15\n Scenario: The user is able to navigate to \"Practice Questions\" in stack Page\n Given The user is on the Stack page after logged in\n When The user clicks on the Operations in Stack link \n And  The user clicks on the Practice Questions button\n Then  The user should be redirected to Practice Questions page\n \n \n","mediaType":"text/x.cucumber.gherkin+plain"}},{"gherkinDocument":{"uri":"file:///Users/Naveena/eclipse-workspace/DsAlgo/src/test/resources/Features/StackPage.feature","feature":{"location":{"line":2,"column":1},"tags":[{"location":{"line":1,"column":1},"name":"@tagStack","id":"71d03ca1-9fb6-415d-9da1-d522664987d7"}],"language":"en","keyword":"Feature","name":"Stack","description":"  I want to use this template for my feature file","children":[{"scenario":{"location":{"line":6,"column":2},"tags":[{"location":{"line":5,"column":1},"name":"@tagStack1","id":"69dbbba7-a3d2-4c22-bdb3-eafd435eef6a"}],"keyword":"Scenario","name":"SignInPage","description":"","steps":[{"location":{"line":7,"column":2},"keyword":"Given ","keywordType":"Context","text":"The user is on Signin page of DS Algo portal","id":"0f1dfea0-1ed2-4ce8-88ed-e4ec6c052e71"},{"location":{"line":8,"column":2},"keyword":"When ","keywordType":"Action","text":"The user enter valid \"Numpy@108_1\" and \"Welcome108\"","id":"614990e7-5579-4eaa-bf59-42c28704d1b3"},{"location":{"line":9,"column":2},"keyword":"And ","keywordType":"Conjunction","text":"The user click on login button","id":"de4140b7-f38b-491b-93d4-98720d593090"},{"location":{"line":10,"column":2},"keyword":"Then ","keywordType":"Outcome","text":"The user is redirected to homepage","id":"4995e420-94cb-43b9-b2d9-a038525c0e51"}],"examples":[],"id":"5356c2c7-97b3-4bf
